import React from 'react';

import { withRouter } from "react-router-dom";
import { connect } from "unistore/react";
import { actions } from "../store";

class Destinasi extends React.Component {

    componentDidMount = () => {
        this.props.kategoriKota()
    }

    render() {

        <React.Fragment>
            <div>
            {this.props.listDestinasi.map((isi,i)=>(
                    <div>
                        <h1> this is Gambar : {isi.caption}</h1>
                    </div> 
                )   
                )}
            </div>
        </React.Fragment>
    }
};

export default connect("listDestinasi, listHasilTriposo, idKota, isLoading", actions)(withRouter(Destinasi));
